import 'bootstrap/dist/css/bootstrap.min.css';
import { Container, Row, Col } from 'react-bootstrap';

function App() {
	return (
		<div className='appContainer'>
			<Container>
				<Row>
					<Col sm={3}>sm=8</Col>
					<Col sm={9}>sm=4</Col>
				</Row>
			</Container>
		</div>
	);
}

export default App;
